import img from './IMG-1.png'
function Card() {
  return (
  	<div>
  		<img alt='Calligraphy' src={img} />
 	    <div>
		    <h2>Lubna Calligraphy</h2>
		    <p>Handwritten Arabic Calligraphy by Lubna</p>
	    </div>
	</div>
  );
}

export default Card;
